<H1><A NAME="c4185"></A>Compiler Warning (level 1) C4185</H1>

<P class=dt><B>ignoring unknown #import attribute 'attribute'</B></P>

<P>The <I>attribute</I> is not a valid attribute of <B>#import</B>. It is ignored. For example:</P>

<PRE><CODE>#import "olepro32.dll" no_such_attribute
</CODE></PRE>

<P>The attribute <CODE>no_such_attribute</CODE> does not belong to <B>#import</B>.</P>
